import { React, useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { useLocation } from 'react-router-dom';

const PartnerDashboard = () => {

    const { restaurant, restaurants } = useSelector(state => ({ ...state }));
    const [restaurantDet, setRestaurantDet] = useState(restaurant || '');
    const location = useLocation();

    useEffect(() => {
        console.log('Check-->loc: ', location);
        if(!restaurant) {
            setRestaurantDet(restaurants?.filter(rest => rest._id === location.pathname))
        }
    }, [restaurant, restaurants])

    return (
        <div className='container-fluid my-5 px-md-5'>
            <div className='row mt-5 pt-5 mx-md-2'>
                <div className='col-lg-8 col-10 offset-lg-2 offset-1 p-md-4 p-3 text-center shadow'>
                    <h3 className="text-center">{restaurant?.restaurantName}</h3>
                    <div className="row p-5">
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Contact:</label>
                            <span className="ps-2">
                                {restaurant?.contact}
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Email:</label>
                            <span className="ps-2">
                                {restaurant?.email}
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Address:</label>
                            <span className="ps-2">
                                {restaurant?.restaurantAddress}, {restaurant?.city}, {restaurant?.state}, {restaurant?.zipCode}
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Status:</label>
                            <span className="ps-2">
                                {restaurant?.status}
                            </span>
                        </div>
                        <div className="col-12 border-top border-3 text-center my-3 pt-3">
                            <h4>Owner Details</h4>
                        </div>

                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">First Name:</label>
                            <span className="ps-2">
                                {restaurant?.firstName}
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Last Name:</label>
                            <span className="ps-2">
                                {restaurant?.lastName}
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Type:</label>
                            <span className="ps-2">
                                {restaurant?.establishmentType}
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Outlet Type:</label>
                            <span className="ps-2">
                                {
                                    restaurant?.outletType.map(outlet => outlet.toLowerCase())?.join(', ')
                                }
                            </span>
                        </div>
                        <div className="col-lg-6 col-12 text-start">
                            <label className="col-form-label text-start fw-bold fs-6">Cuisines Type:</label>
                            <span className="ps-2">
                                {
                                    restaurant?.cuisinesType.map(cuisine => cuisine.toLowerCase())?.join(', ')
                                }
                            </span>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default PartnerDashboard;
